import React from 'react';

import useWindowSize from '../../hooks/useWindowSize';
import { Main } from './style';

const StockPage = () => {
    const winSize = useWindowSize();

    return (
        <Main style={{height:winSize[1]}}>
            재고 관리 페이지
        </Main>
    );
};

export default StockPage;
